import React from 'react';
import s from './ProfileInfo.module.css';

const ProfileInfo = () => {
    return (
        <div>
            <div className={s.descriptionBlock}>
               <div>Имя пользователя: Ослепительный Зубр</div>
                <div>Рейтинг: 5</div>
                <div>Интересы: Наука, Кино, Путешествия
                <span>Изменить</span>
                </div>

            </div>
        </div>
    )
}

export default ProfileInfo;
